em (including services to which items 81100, 81110 and 81120 apply).\n','1970-01-01','1970-01-01'),('81105','0','2007-05-01','1970-01-01','8','M9','','','D','N','','N','N','N','N','N','N','P','B','2007-05-01','2012-11-01',19.90,0.00,16.95,0.00,0.00,'2012-11-01','1970-01-01',0.00,300.00,500.00,'','1970-01-01','1970-01-01',NULL,NULL,'2010-11-01','DIABETES EDUCATION SERVICE GROUP SERVICE Diabetes education health service provided to a person by an eligible diabetes educator, as a GROUP SERVICE for the management of type 2 diabetes if:(a) the person has been assessed as suitable for a type 2 diabetes group service under assessment item 81100, 81110 or 81120; and(b) the service is provided to a person who is part of a group of between 2 and 12 patients inclusive; and (c) the person is not an admitted patient of a hospital; and(d) the service is provided to a person involving the personal attendance by an eligible diabetes educator; and(e) the service is of at least 60 minutes duration; and(f) after the last service in the group services program provided to the person under items 81105, 81115 or 81125, the eligible diabetes educator prepares, or contribute to, a written report to be provided to the referring medical practitioner; and(g) an attendance record for the group is maintained by the eligible diabetes educator; and(h) in the case of a service in respect of which a private health insurance benefit is payable - the person who incurred the medical expenses in respect of the service has elected to claim the Medicare benefit in respect of the service, and not the private health insurance benefit;- to a maximum of eight GROUP SERVICES (including services to which items 81105, 81115 and 81125 apply) in a calendar year.\n','1970-01-01','1970-01-01'),('81110','0','2007-05-01','1970-01-01','8','M9','','','D','N','','N','N','N','N','N','N','P','B','2007-05-01','2012-11-01',79.85,0.00,67.90,0.00,0.00,'2012-11-01','1970-01-01',0.00,300.00,500.00,'','1970-01-01','1970-01-01',NU